('1', 'Sociedade Anónima', 'S.A.', 'Sociedade comercial cujo capital está dividido em ações e a responsabilidade dos sócios é limitada ao valor das ações subscritas.', '1', '2025-04-09 10:06:36', '2025-04-09 10:06:36'),
('2', 'Sociedade por Quotas', 'Lda.', 'Sociedade comercial em que o capital está dividido em quotas e os sócios são solidariamente responsáveis por todas as entradas convencionadas.', '1', '2025-04-09 10:06:36', '2025-04-09 10:06:36'),
('3', 'Sociedade Unipessoal por Quotas', 'Unipessoal Lda.', 'Sociedade por quotas com um único sócio, pessoa singular ou coletiva.', '1', '2025-04-09 10:06:36', '2025-04-09 10:06:36'),
('4', 'Sociedade Gestora de Participações Sociais', 'SGPS', 'Sociedade que tem por objeto contratual a gestão de participações sociais noutras sociedades.', '1', '2025-04-09 10:06:36', '2025-04-09 10:06:36'),
('5', 'Entidade Pública Empresarial', 'E.P.E.', 'Pessoa coletiva de direito público, com natureza empresarial.', '1', '2025-04-09 10:06:36', '2025-04-09 10:06:36'),
('6', 'Sociedade Anónima de Responsabilidade Limitada', 'S.A.R.L.', 'Forma societária de responsabilidade limitada, menos comum em Portugal.', '1', '2025-04-09 10:06:36', '2025-04-09 10:06:36'),
('7', 'Empresário em Nome Individual', 'ENI', 'Pessoa singular que exerce uma atividade económica sem constituir uma sociedade.', '1', '2025-04-09 10:06:36', '2025-04-09 10:06:36'),
('8', 'Sociedade em Comandita', 'S.C.', 'Sociedade em que pelo menos um dos sócios responde ilimitadamente pelas dívidas sociais e os restantes limitadamente.', '1', '2025-04-09 10:06:36', '2025-04-09 10:06:36'),
('9', 'Cooperativa', 'Coop.', 'Associação autónoma de pessoas que se unem voluntariamente para satisfazer necessidades económicas, sociais e culturais comuns.', '1', '2025-04-09 10:06:36', '2025-04-09 10:06:36'),
('10', 'Instituição Particular de Solidariedade Social', 'IPSS', 'Instituição constituída por iniciativa privada, sem finalidade lucrativa, com o propósito de dar expressão ao dever moral de solidariedade.', '1', '2025-04-09 10:06:36', '2025-04-09 10:06:36')
